{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/afdalelwirano/case-study-cyclistic?scriptVersionId=105743749\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"f3a98146","metadata":{"papermill":{"duration":0.012214,"end_time":"2022-09-15T13:03:43.750259","exception":false,"start_time":"2022-09-15T13:03:43.738045","status":"completed"},"tags":[]},"source":["# Case Study: Cyclistic Bike-share\n","## Capstone Project Google Data Analytics\n","### Author: Afdal Elwirano\n","### Date: 2022-07-20"]},{"cell_type":"markdown","id":"cf924898","metadata":{"papermill":{"duration":0.0071,"end_time":"2022-09-15T13:03:43.764724","exception":false,"start_time":"2022-09-15T13:03:43.757624","status":"completed"},"tags":[]},"source":["## INTRODUCTION\n","\n","Capstone project is the final part of the **Google Data Analytics Certificate**. This project asks students to conduct a case study. I chose case study 1: **Cyclistic** (a fictional bike-share company in Chicago). For completing the case study, I will use Microsoft Excel, RStudio, and Tableau (if needed). The case study will follow the 6 phases of data analysis (**Ask**, **Prepare**, **Process**, **Analyze**, **Share**, and **Act**). \n","\n","\n","## SCENARIO\n","\n","I work as a junior data analyst in the marketing analyst team at Cyclistic: a bike-share company in Chicago. Cyclistic features more than 5800 bicycles and 600 docking stations. There are two types of rider: casual riders (single-ride or full-day passes) and Cyclistic members (who purchase annual membership).The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, marketing analyst team needs to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, the company will propose a new marketing strategy aimed to convert casual riders into Cyclistic members.\n","\n","\n","**Note**: I tried to process 12 months data and found out that my system didn't support. Therefore, I will only use 3 months of data (January to March 2022) as quarter 1 of fiscal year 2022. And I would slightly modify the scenario. Instead of year, I will use quarter.  \n","\n","\n","## ASK\n","\n","The company concerns on three questions:\n","\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","From the questions above, I can clearly understand my task (Determining the differences between casual riders and annual members on how they use Cyclistic bikes using historical trip data in order to run a new online marketing strategy that would motivate casual riders purchase annual subscriptions). The main stakeholders here are the director of marketing and my manager(Lily Moreno) and Cyclistic executive team.\n","\n","\n","## PREPARE\n","\n","The [data](https://divvy-tripdata.s3.amazonaws.com/index.html) has been made available by Motivate International Inc, under this [License](https://www.divvybikes.com/data-license-agreement). The data is qualified as ROCCC (Reliable, Original, Comprehensive, Current, and Cited). The 3 months data has been downloaded as Zip files and stored locally on my laptop. The data has 503424 observations and 13 variables (Before pre-cleaning). The 13 variables are: ride_id, rideable_type, started_at, ended_at, start_station_name, start_station_id, end_station_name, end_station_id, start_lat, end_lat, start_lng, end_lng, member_casual. \n","I have done pre-cleaning using Microsoft Excel. I removed all rows that contain missing values. As for ride_id variable have to be unique and I found out there was not any duplicate entries. After pre-cleaning, the data has 385292 observations and 13 variables.\n","\n","\n","## PROCESS\n","\n","The data has been inspected and pre-cleaned using Microsoft Excel prior to importing it into RStudio. RStudio was chosen for this phase for learning purposes. Rstudio will be used as the tool for data manipulation, analysis, and visualizations. RMarkdown will be used for documenting and creating a report.  \n","\n","#### Installing and loading packages needed"]},{"cell_type":"code","execution_count":1,"id":"3c473c2c","metadata":{"execution":{"iopub.execute_input":"2022-09-15T13:03:43.785088Z","iopub.status.busy":"2022-09-15T13:03:43.781999Z","iopub.status.idle":"2022-09-15T13:03:45.337054Z","shell.execute_reply":"2022-09-15T13:03:45.335211Z"},"papermill":{"duration":1.567493,"end_time":"2022-09-15T13:03:45.339523","exception":false,"start_time":"2022-09-15T13:03:43.77203","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: ‘scales’\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    discard\n","\n","\n","The following object is masked from ‘package:readr’:\n","\n","    col_factor\n","\n","\n"]}],"source":["library(tidyverse)\n","library(janitor)\n","library(dplyr)\n","library(ggplot2)\n","library(readxl)\n","library(lubridate)\n","library(scales)"]},{"cell_type":"markdown","id":"2530f481","metadata":{"papermill":{"duration":0.008182,"end_time":"2022-09-15T13:03:45.355617","exception":false,"start_time":"2022-09-15T13:03:45.347435","status":"completed"},"tags":[]},"source":["#### Importing data to RStudio"]},{"cell_type":"code","execution_count":2,"id":"7d79af2f","metadata":{"execution":{"iopub.execute_input":"2022-09-15T13:03:45.403755Z","iopub.status.busy":"2022-09-15T13:03:45.373156Z","iopub.status.idle":"2022-09-15T13:03:54.305085Z","shell.execute_reply":"2022-09-15T13:03:54.303061Z"},"papermill":{"duration":8.945333,"end_time":"2022-09-15T13:03:54.308736","exception":false,"start_time":"2022-09-15T13:03:45.363403","status":"completed"},"tags":[]},"outputs":[],"source":["trips_2022_01 <- read_excel(\"../input/cyclistic-modified/trips_2022_01.xlsx\")\n","trips_2022_02 <- read_excel(\"../input/cyclistic-modified/trips_2022_02.xlsx\")\n","trips_2022_03 <- read_excel(\"../input/cyclistic-modified/trips_2022_03.xlsx\")"]},{"cell_type":"markdown","id":"b6e77799","metadata":{"papermill":{"duration":0.008866,"end_time":"2022-09-15T13:03:54.327124","exception":false,"start_time":"2022-09-15T13:03:54.318258","status":"completed"},"tags":[]},"source":["#### Processing data\n","the 3 data sets has been imported to RStudio. Let see if all data sets have the same structure, so we can merge them into a single