   | Shedd Aquarium                     | casual |  39 |\n","| Michigan Ave &amp; Oak St              | Michigan Ave &amp; Oak St              | casual |  37 |\n","| Dusable Harbor                     | Dusable Harbor                     | casual |  35 |\n","| Millennium Park                    | Streeter Dr &amp; Grand Ave            | casual |  30 |\n","| DuSable Lake Shore Dr &amp; Monroe St  | Shedd Aquarium                     | casual |  29 |\n","| DuSable Lake Shore Dr &amp; North Blvd | DuSable Lake Shore Dr &amp; North Blvd | casual |  29 |\n","\n"],"text/plain":["   start_station_name                 end_station_name                  \n","1  Streeter Dr & Grand Ave            Streeter Dr & Grand Ave           \n","2  DuSable Lake Shore Dr & Monroe St  DuSable Lake Shore Dr & Monroe St \n","3  DuSable Lake Shore Dr & Monroe St  Streeter Dr & Grand Ave           \n","4  Montrose Harbor                    Montrose Harbor                   \n","5  Millennium Park                    Millennium Park                   \n","6  Shedd Aquarium                     Streeter Dr & Grand Ave           \n","7  Streeter Dr & Grand Ave            DuSable Lake Shore Dr & Monroe St \n","8  Streeter Dr & Grand Ave            Millennium Park                   \n","9  Shedd Aquarium                     Millennium Park                   \n","10 Shedd Aquarium                     Shedd Aquarium                    \n","11 Michigan Ave & Oak St              Michigan Ave & Oak St             \n","12 Dusable Harbor                     Dusable Harbor                    \n","13 Millennium Park                    Streeter Dr & Grand Ave           \n","14 DuSable Lake Shore Dr & Monroe St  Shedd Aquarium                    \n","15 DuSable Lake Shore Dr & North Blvd DuSable Lake Shore Dr & North Blvd\n","   user_type count\n","1  casual    131  \n","2  casual    112  \n","3  casual     90  \n","4  casual     64  \n","5  casual     61  \n","6  casual     59  \n","7  casual     51  \n","8  casual     44  \n","9  casual     43  \n","10 casual     39  \n","11 casual     37  \n","12 casual     35  \n","13 casual     30  \n","14 casual     29  \n","15 casual     29  "]},"metadata":{},"output_type":"display_data"}],"source":["#member's popular route and bike\n","Q1_2022_trips %>% \n","  group_by(start_station_name, end_station_name, bike_type) %>% \n","  filter(user_type == 'member') %>% \n","  summarize(count = n()) %>% \n","  arrange(desc(count)) %>% \n","  head(15)\n","#casual's popular route and bike\n","Q1_2022_trips %>% \n","  group_by(start_station_name, end_station_name, bike_type) %>% \n","  filter(user_type == 'casual') %>% \n","  summarize(count = n()) %>% \n","  arrange(desc(count)) %>% \n","  head(15)\n","#docked_bike\n","Q1_2022_trips %>% \n","  group_by(start_station_name, end_station_name, user_type) %>% \n","  filter(bike_type == 'docked_bike') %>% \n","  summarize(count = n()) %>% \n","  arrange(desc(count)) %>% \n","  head(15)"]},{"cell_type":"markdown","id":"3262385d","metadata":{"papermill":{"duration":0.01965,"end_time":"2022-09-15T13:04:24.447011","exception":false,"start_time":"2022-09-15T13:04:24.427361","status":"completed"},"tags":[]},"source":["**note**: I still can't figure out how to visualize the data above. However, the tables have given enough information already.\n","\n","Based on both tables above, I discover the main different between two type of riders is that casual rides mostly around recreational areas while member are the opposite. \n","\n","#### Analysis points\n","So far, I have analyzed and discovered interesting patterns from the data. I'll wrap up the points of my analysis:\n","\n","* The different on number of rides between casual and member\n","\n","* The average duration of rides taken by both casual and member\n","\n","* The differences between casual riders and annual members based on number of rides taken per day\n","\n","* The average duration rides per day taken by both user types\n","\n","* The differences on number of rides taken by casual and member per 24 hour\n","\n","* The average duration ride times taken by member and casual per hour on a scale of 24 hour\n","\n","* The differences between weekday and weekend rides based on start hours by both user types\n","\n","* The most preferred bike type from both user types\n","\n","* The most popular routes or stations by both member and casual\n","\n","\n","#### Key differences\n","Based on the data that has been analyzed, some trends and patterns were discovered. Here are some key takeaways:\n","\n","* Members ride more than casual while casuals ride longer on average than member. My hypothesis is members mostly use the bike for short rides or short distance and casual use the bike for long rides or longer distance. \n","\n","* Members mostly use the bike during work days while casual mostly use it on the weekend. My hypothesis is members are mostly workers or students who use the service to commute and casuals are most probably visitors or tourists who use the bike for leisure activities. And looking at the average duration each day, I can see that casual has longer rides on Saturday and Sunday while members are roughly the same with about 11 minutes ride.  \n","\n","* Members have high number of rides between 7 to 8 am and 4 to 5 pm while casual have pyramid pattern with the top at 5 pm. From this trend, I can strengthen my previous hypothesis, members are most probably workers or students. \n","\n","* From Monday to Friday, number of rides from member peak at commuting hour (7 to 8 am and 4 to 5 pm) while casual peak from 12 to 5 pm. And during the weekend member and casual have showed the same trends. From this relationship, I can strengthen my previous hypothesis that members are mostly worker or students.\n","\n","* Both user types prefer classic bike than electric bike and only casual who rides docked bike. My hypothesis are:  first, classic bike have higher availability than electric bike and docked bike has the lowest availability. Second, Casual riders use docked bike because of the higher availability rate of docked bike in their rides area.   \n","\n","* Based on the tables, Member shows the highest number of rides around University Ave & 57th St, Ellis Ave & 60th St, and Ellis Ave & 55th St while casual usually bikes around city center near the bay. The three most popular station by casual riders are DuSable Lake Shore Dr & Monroe St, Millennium Park, and Streeter Dr & Grand Ave. My hypothesis is members cover more area of the city while casuals mostly rides around the touristic area by the coastline. \n","\n","\n","## Share\n","\n","I have covered a lot so far, and it is time to wrapping up and drive conclusion based on the data that I have analyzed. And I will share my findings with the team in a report format with help from RMarkdown.     \n","\n","#### Conclusion\n","\n","* Annual members are mostly daily commuter and they regularly ride for short time or distance. On the other hand, casual riders are mostly visitors or tourist and they generally ride for longer duration or distance.\n","\n","* Annual members number of rides usually higher during weekday and lower on the weekend. In contrast, casual riders number of ride usually higher on the weekend and fluctuated during weekday.   \n","\n","* Annual members cover more area of the city and they usually ride either classic bike or electric bike. In contrary, casual riders cover less area which mostly focused in the heart of the city along the coastline and they basically ride all three types of bike.\n","\n","\n","## Act\n","\n","In this phase, I will share the top three recommendations based on my analysis:\n","\n","1. The new marketing campaigns should be focused on weekend when casuals ride the most and stations where casuals usually take the bike.\n","\n","2. Introduce new subscription packages such as 30 days pass with 7 days free trial. \n","\n","3. Referral discount should be applied. For instance, every person who have successfully invited 3 people using his/her unique link will get 25% off. \n","\n","\n","Thank you for reading till the very end!!!\n","Hope to hear some comments and suggestion from my fellow future data analyst :)\n","\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":45.037283,"end_time":"2022-09-15T13:04:24.689509","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-09-15T13:03:39.652226","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}